import React from "react";
import Card from './Card';


const CardList = ({ pokedex }) => {
    return (
        <tbody>
            {
                pokedex.map((user,i) => {
                    return (
                        <Card 
                            key={i}
                            id={pokedex[i].id} 
                            name={pokedex[i].name} 
                            num={pokedex[i].num}
                            img={pokedex[i].img}
                            types={pokedex[i].type}
                            next={!pokedex[i].next_evolution ? 
                                'No evolutions' : 
                                pokedex[i].next_evolution.map((user, i) => {
                                    return user.name;
                                    console.log(user.name);
                                })}
                        />
                    );
                })
            }
        </tbody>
    )
} 

export default CardList;
